import { useState } from "react";

async function getSubmissionListWithContest() {
  return fetch(
    "http://127.0.0.1:8000/admin/photo/submission/",
    {
      method: "GET",
      headers: {
        "Content-Type": "application/json",
      },
    }
  ).then((data) => {console.log(data); return data.json()});
}

export async function getStaticProps() {
  const movieList = await getSubmissionListWithContest();
  return {
    props: {
      movieList,
      allMovies,
      topFive,
    },
  };
}

